import angel from "../../../illustrations/angel.png";
import brainmush from "../../../illustrations/brainmush.png";
import oceanview from "../../../illustrations/oceanview.png";
import dragon from "../../../illustrations/dragon.png";
import picnic from "../../../illustrations/picnic.png";

let galleryArr = [
    {src: angel, alt: "Angel"}, 
    {src: brainmush, alt: "Brain Mush"},
    {src: oceanview, alt: "Ocean View"},
    {src: picnic, alt: "Midnight Picnic"},
    {src: dragon, alt: "Marshmallow friends"},
];

export default galleryArr;
